import React from 'react'
import { Button } from 'primereact/button';
export default function Banner({ titles,active }) {
    return (
        <div className='bg-banner-color h-auto w-full grid grid-flow-col p-2'>

            <div className=' w-3/4 border border-black rounded-sm bg-space-between-border p-2 grid grid-flow-col drop-shadow-md'>
                {titles.map((header, index) =>
                    <span className={`mx-2 bg-banner-color text-white justify-space-between text-center rounded-md drop-shadow-md hover:bg-violet-600 ${active.includes(header) ? 'border-2 border-white':'' }`}
                    onClick={() => {
                        active.pop()
                        active.push(header)
                    }}
                    >
                        {header}
                    </span>
                )}
            </div>

            <div className='p-2 text-white'>
                Time
            </div>
            <div className='p-2 text-white'>
                logo
            </div>


        </div>
    )
}
